import Titulo from './Titulo'
import BotaoAlternarTema from './BotaoAlternarTema'
import React from 'react';



export default function Cabecalho() {

    return (
        <div className={`flex`}>
            <Titulo />
            <div className={`flex flex-grow justify-end items-center`}>
            </div>
        </div>
    )
}
